import React from "react";

const Experience = () => {
  return (
    <section id="experience" className="text-center max-w-4xl mx-auto">
      <h2 className="text-3xl font-bold mb-4">Experience</h2>
      <ul className="space-y-4 text-left">
        <li>
          <strong>Backend Developer - Startup (Present)</strong><br/>
          Built APIs with FastAPI, optimized DB queries, deployed on GCP.
        </li>
        <li>
          <strong>Software Engineer - Accenture (2 yrs)</strong><br/>
          Maintained SAP backend, developed features in Java, handled large datasets with SQL Server.
        </li>
        <li>
          <strong>Intern - Hyphenova</strong><br/>
          Delivered working code within a week, used FastAPI and PostgreSQL.
        </li>
      </ul>
    </section>
  );
};

export default Experience;
